import React, { Component } from 'react';
import Nav from 'react-bootstrap/Nav';
import { Link } from 'react-router-dom'; 
import TabContainer from 'react-bootstrap/TabContainer';
import TabContent from 'react-bootstrap/TabContent';
import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs';
import Container from 'react-bootstrap/Container';
import styles from './Homepage.css';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import PopUpMe from './popUpMe.js';


class Homepage extends Component{
	 state = {
	   seen: false
	   };

	  togglePop = () => {
	   this.setState({
	    seen: !this.state.seen
	   });
	  };
	render(){
	return(
		<div className="intro-box">

			<h1 className="intro">Hello, my name is</h1>
			<div className="name" onClick={this.togglePop}>
				<h1 className="intro">Diana. </h1>
			</div>
			{this.state.seen ? <PopUpMe toggle={this.togglePop} /> : null}

			<h1 className="intro"> I am a <Link to="/portfolio" className="jobtitles"> developer </Link> & <Link to="/portfolio" className="jobtitles">designer</Link>, currently based in the Bay Area. </h1>
			<br/>
			<Row>
				<Col> <a href="mailto:diananhoang@gmail.com" target="_blank"> <img className="icon" src={`${process.env.PUBLIC_URL}/assets/mail.png`}
    					onMouseOver={e => (e.currentTarget.src= "../../public/assests/openmail.png")}
    					onMouseOut={e => (e.currentTarget.src = "mail.png")}
  					/> </a>
  				</Col>

 				<Col> <a href="https://www.linkedin.com/in/dnhoang/" target="_blank"> <img className="icon" src={`${process.env.PUBLIC_URL}/assets/in.png`}
    					onMouseOver={e => (e.currentTarget.src = "inopen.png")}
    					onMouseOut={e => (e.currentTarget.src = "in.png")}
  					/> </a>  
  				</Col>
				<Col> <a href="https://www.instagram.com/dianax3dh/" target="_blank"> <img className="icon" src={`${process.env.PUBLIC_URL}/assets/ig.png`}
    					onMouseOver={e => (e.currentTarget.src = "igopen.png")}
    					onMouseOut={e => (e.currentTarget.src = "ig.png")}
  					/> </a>
  				</Col>

			</Row>
		</div>
		);
}

}

export default Homepage;
